import React from 'react';
import ReactDOM from 'react-dom';
import * as serviceWorker from '../serviceWorker';
import withConnect from '../components/withConnect';
import MultiChannel from '../components/multi-channel';
import { methods, samplePayload } from '../components/multi-channel/payload';
import { AnnotationType } from '../types';

const SpeechAnalysisComp: React.FC = withConnect({ type: AnnotationType.PHONETIC_TRANSCRIPTION, methods, samplePayload })(MultiChannel);

ReactDOM.render(
  <SpeechAnalysisComp />,
  document.getElementById('root'),
);

serviceWorker.unregister();
